import React from "react";
import mangekyou from "./Assets/mangekyou.png";
import "./App.css";
import Typewriter from "typewriter-effect";
import NavBar from "./Components/NavBar";
import NavBar2 from "./Components/NavBarNew";

function App() {
  return (
    <div>
      <NavBar2 />
      <section>
        <header className="App-header">
          <h1 style={{ fontWeight: "normal" }}>
            <div className="Center">
              My hobbies:{" "}
              <span style={{ color: "#3CAAAE", fontWeight: "bold" }}>
                <Typewriter
                  options={{
                    strings: ["Anime", "Video Games", "Food"],
                    autoStart: true,
                    loop: true,
                    deleteSpeed: 100,
                  }}
                />
              </span>
              <img src={mangekyou} className="App-logo" alt="logo" />
              <p style={{ fontSize: "28px" }}>
                Richi you're under my genjutsu c:
              </p>
            </div>
          </h1>
        </header>
      </section>
    </div>
  );
}

export default App;
